burnin’ ring of fire 🖤🔥🎶
this look is inspired by the amazing @johnnycash ❤️‍🔥 everyone knows the song “Ring of Fire” but do you know the history of the song? It was co-written by June Carter about falling in love with Cash despite his wild lifestyle..... & the fact that he was still married to his 1st wife, Vivian. 🫢 She didn’t even intend for Cash to record it & her sister, Anita Carter, originally recorded the song under the name “(Love’s) Ring of Fire” on 10/24/62. Cash liked the song & wanted to record his own version, but he waited 6 months to see if Anita’s version would become a hit first. When this failed to happen he recorded his own version on 3/25/63. It was released on 4/19/63 (over 4 years before his divorce). Cash went on to marry June Carter on 3/1/68 & they remained married for the rest of their lives. The song’s other co-writer, songwriter & producer Merle Kilgore, was actually the best man at their wedding. “Ring of Fire” is ranked #87 in @rollingstone “500 Greatest Songs of All Time” & #4 in @cmt “100 Greatest Songs of Country Music”. Cash’s daughter, @rosannecash , stated “the song was about the transformative power of love, and that’s what is has always meant to me. That’s what it will always mean to the Cash children.”

