burnin’ ring of fire 🖤🔥🎶
this look is inspired by the amazing @johnnycash ❤️‍🔥 “Hurt” is by far my favorite song of his & it wasn’t even recorded until 2002 in the last years of his life. It all started when @rickrubin saw Cash performing in 1992. He recognized how important Cash had been to the music industry but that people had written him off so long ago & Cash started to as well. He approached him about working together, but Cash was skeptical Rubin proposed that he just play whatever he felt like & they recorded them casually with a single guitar. The album they eventually created was an amazing success and they continued recording together.  Rubin sent Cash “Hurt”, which was actually a Nine Inch Nails song released in 1995, and he didn’t see Rubin’s vision, but recorded it regardless. When Trent Reznor, Nine Inch Nails’ front man, was approached about a potential cover he was flattered, but thought the idea sounded gimmicky. When he saw the final result he stated that the song wasn’t his anymore & belonged to Cash. “Hurt” is a very raw and emotional song and as Rubin stated, “If you listen to the words, it’s like looking back over a life of regret and remorse.” 🖤

