"there is beauty in everything. just not everybody sees it" -andy warhol 💙🌐🌀🦋
one of my absolute favorite quotes because it's SO TRUE! the inspiration for this look was a photo of a horsetail (a plant that kind of looks like bamboo) under a microscope. an unsuspecting object that Olivier Leroux was able to see the beauty in and then share that beauty with the world. try to take the time today to notice the beauty that exists all around you 🩵 the technique I used to make the mask is called yarn painting and it was created by the Wixárika people of Mexico in the 1960's. I'm posting a video tomorrow that discusses this more in depth but it's another brilliant example of thinking outside the box and creating masterpieces with ordinary objects! (🔗 in my bi0 for more info on the Wixárika & yarn painting 🧶)

look ib a photo of a horsetail stem stained white under a microscope by Olivier Leroux
yarn painting technique used was created by the Wixárika people of Mexico (I originally made this post and used the name "Huichol", I have since been taught that this name was given to them by the colonizers. I am so sorry to the Wixárika people and anyone I might have offended. I have updated all my posts accordingly and will only use the Wixárika name moving forward. Thank you so much to the person who took the time to educate me and I will do more research moving forward!)

