freaks have more fun 🎃🕯️❤️‍🔥
I call myself “weird” a lot & people try to correct me because in their opinion the term “weird” only has negative connotations. I was bullied a lot growing up & was called TONS of different things, but a big one that always seemed to show up was that I was weird. I took a lot of offense to it & tried my hardest just to fit in and be “normal”. While this temporarily helped, I began to feel like I was losing myself & that life was just a performance. I didn’t feel like anyone truly knew ME anymore & knew something had to change. I started embracing my weirdness & instead of trying to fit in with people that didn’t appreciate that side of me, I found friends that were just as weird as I was. The best part though was that life was SO MUCH MORE FUN when surrounded by fellow weirdos. There was no pressure to be “normal”, “serious”, “act mature”, or to fit in to societal expectations. We were free to act like children again, laugh until we cried, & didn’t take things too seriously (you all know who you are & I love you infinitely 🫶🏻). There are a lot of people that still judge me when I’m wearing a hot dog costume, doing VERY awkward dances, discussing random frog facts I know, or any of the other numerous unconventional things I do on a daily basis. However, I don’t feel ashamed to be weird anymore. After living both ways, I can definitely say that being weird is WAY more fun 🥹🖤

